package com.example.asm_java_nangcao1.Model;import java.util.Date;public class khoHang_Model {    private String idSanPham;    private String tenSanPham;    private String giaSanPham;    private int loaiSanPham;    private String xuatXu;    private String ngayNhap;    private String hinhAnh;    public khoHang_Model() {    }    public khoHang_Model(String idSanPham, String tenSanPham, String giaSanPham, int loaiSanPham, String xuatXu, String ngayNhap, String hinhAnh) {        this.idSanPham = idSanPham;        this.tenSanPham = tenSanPham;        this.giaSanPham = giaSanPham;        this.loaiSanPham = loaiSanPham;        this.xuatXu = xuatXu;        this.ngayNhap = ngayNhap;        this.hinhAnh = hinhAnh;    }    public String getIdSanPham() {        return idSanPham;    }    public void setIdSanPham(String idSanPham) {        this.idSanPham = idSanPham;    }    public String getTenSanPham() {        return tenSanPham;    }    public void setTenSanPham(String tenSanPham) {        this.tenSanPham = tenSanPham;    }    public String getGiaSanPham() {        return giaSanPham;    }    public void setGiaSanPham(String giaSanPham) {        this.giaSanPham = giaSanPham;    }    public int getLoaiSanPham() {        return loaiSanPham;    }    public void setLoaiSanPham(int loaiSanPham) {        this.loaiSanPham = loaiSanPham;    }    public String getXuatXu() {        return xuatXu;    }    public void setXuatXu(String xuatXu) {        this.xuatXu = xuatXu;    }    public String getNgayNhap() {        return ngayNhap;    }    public void setNgayNhap(String ngayNhap) {        this.ngayNhap = ngayNhap;    }    public String getHinhAnh() {        return hinhAnh;    }    public void setHinhAnh(String hinhAnh) {        this.hinhAnh = hinhAnh;    }}